import React from 'react';
import { CheckIcon } from '@heroicons/react/24/outline';
import { motion } from 'framer-motion';
import { useScrollAnimation, staggerContainer, fadeInUp, scaleIn } from '../hooks/useScrollAnimation';

const Pricing = () => {
  const plans = [
    {
      name: 'Basic Care',
      price: '$99',
      period: 'per visit',
      description: 'Perfect for routine checkups and basic dental care',
      features: [
        'Dental examination',
        'Professional cleaning',
        'X-rays (if needed)',
        'Treatment consultation',
        'Oral health advice'
      ],
      popular: false,
      color: 'border-gray-200'
    },
    {
      name: 'Comprehensive Care',
      price: '$299',
      period: 'per visit',
      description: 'Complete dental care with advanced treatments',
      features: [
        'Everything in Basic Care',
        'Deep cleaning & scaling',
        'Cavity fillings',
        'Root canal treatment',
        'Emergency care included',
        'Follow-up appointments'
      ],
      popular: true,
      color: 'border-primary'
    },
    {
      name: 'Premium Care',
      price: '$599',
      period: 'per visit',
      description: 'Advanced cosmetic and restorative procedures',
      features: [
        'Everything in Comprehensive Care',
        'Teeth whitening',
        'Dental veneers',
        'Crowns & bridges',
        'Dental implants',
        'Cosmetic consultations'
      ],
      popular: false,
      color: 'border-gray-200'
    }
  ];

  const { ref, isInView } = useScrollAnimation();

  return (
    <section className="section-padding bg-white">
      <div className="container-custom">
        <motion.div 
          className="text-center mb-16"
          ref={ref}
          initial="hidden"
          animate={isInView ? "visible" : "hidden"}
          variants={fadeInUp}
        >
          <h2 className="font-heading font-bold text-4xl md:text-5xl mb-6 text-text-dark tracking-wide">
            Transparent Pricing
          </h2>
          <p className="text-xl text-text-dark/70 max-w-3xl mx-auto leading-relaxed">
            We believe in transparent pricing with no hidden fees. Choose the plan that best fits your dental care needs.
          </p>
        </motion.div>

        <motion.div 
          className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-6xl mx-auto"
          variants={staggerContainer}
          initial="hidden"
          animate={isInView ? "visible" : "hidden"}
        >
          {plans.map((plan, index) => (
            <motion.div
              key={index}
              className={`relative bg-white rounded-2xl shadow-lg border-2 ${plan.color} p-8 card-hover ${
                plan.popular ? 'ring-2 ring-primary ring-opacity-50' : ''
              }`}
              variants={scaleIn}
              whileHover={{ 
                y: -10,
                transition: { duration: 0.3 }
              }}
            >
              {plan.popular && (
                <div className="absolute -top-4 left-1/2 transform -translate-x-1/2">
                  <span className="bg-primary text-white px-4 py-2 rounded-full text-sm font-semibold">
                    Most Popular
                  </span>
                </div>
              )}

              <div className="text-center mb-8">
                <h3 className="font-heading font-bold text-2xl mb-4 text-text-dark">
                  {plan.name}
                </h3>

                <div className="mb-4">
                  <span className="text-4xl font-bold text-primary">
                    {plan.price}
                  </span>
                  <span className="text-text-dark/70 ml-2">
                    {plan.period}
                  </span>
                </div>

                <p className="text-text-dark/70">
                  {plan.description}
                </p>
              </div>

              <div className="space-y-4 mb-8">
                {plan.features.map((feature, featureIndex) => (
                  <div key={featureIndex} className="flex items-start gap-3">
                    <CheckIcon className="h-5 w-5 text-primary flex-shrink-0 mt-0.5" />
                    <span className="text-text-dark">{feature}</span>
                  </div>
                ))}
              </div>

              <motion.button 
                className={`w-full py-3 px-6 rounded-lg font-semibold transition-all duration-300 ${
                  plan.popular
                    ? 'bg-primary hover:bg-primary/90 text-white'
                    : 'bg-white hover:bg-light-gray text-primary border-2 border-primary'
                }`}
                whileHover={{ scale: 1.02 }}
                whileTap={{ scale: 0.98 }}
              >
                {plan.popular ? 'Get Started' : 'Choose Plan'}
              </motion.button>
            </motion.div>
          ))}
        </motion.div>

        <motion.div 
          className="text-center mt-12"
          variants={fadeInUp}
          initial="hidden"
          animate={isInView ? "visible" : "hidden"}
        >
          <p className="text-text-dark/70 mb-6">
            *Prices may vary based on individual treatment needs. Contact us for a personalized quote.
          </p>
          <motion.button 
            className="btn-secondary"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            View All Services & Pricing
          </motion.button>
        </motion.div>

        {/* Additional Info */}
        <motion.div 
          className="mt-16 grid grid-cols-1 md:grid-cols-3 gap-8 text-center"
          variants={staggerContainer}
          initial="hidden"
          animate={isInView ? "visible" : "hidden"}
        >
          {[
            {
              icon: "M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z",
              title: "Insurance Accepted",
              description: "We work with most major insurance providers"
            },
            {
              icon: "M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1",
              title: "Payment Plans",
              description: "Flexible payment options available"
            },
            {
              icon: "M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z",
              title: "Guaranteed Work",
              description: "We stand behind our work with guarantees"
            }
          ].map((item, index) => (
            <motion.div 
              key={index}
              className="bg-white rounded-xl p-6 shadow-lg border border-border-gray"
              variants={scaleIn}
              whileHover={{ y: -5 }}
            >
              <div className="w-12 h-12 bg-primary/10 rounded-lg flex items-center justify-center mx-auto mb-4">
                <svg className="w-6 h-6 text-primary" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d={item.icon} />
                </svg>
              </div>
              <h4 className="font-semibold text-lg mb-2 text-text-dark">{item.title}</h4>
              <p className="text-text-dark/70 text-sm">{item.description}</p>
            </motion.div>
          ))}
        </motion.div>
      </div>
    </section>
  );
};

export default Pricing;
